import React from 'react';
import styled from 'styled-components';



const Header = () => {
  return (
    <Wrapper>
      <H1>
      Heather Reaper
      </H1>
    </Wrapper>
  )
}

const Wrapper = styled.div`
  height: 100vh;
  width: 100vw;
  background-color: teal;
`;

const H1 = styled.h1`
  font-size: 2rem;
  text-align: center;
`;

export default Header
